function loadjscssfile(a,b){if(b=="js"){fileref=document.createElement("script");fileref.setAttribute("type","text/javascript");fileref.setAttribute("src",a)}else{if(b=="css"){fileref=document.createElement("link");fileref.setAttribute("rel","stylesheet");fileref.setAttribute("type","text/css");fileref.setAttribute("href",a)}}document.getElementsByTagName("head")[0].appendChild(fileref)}function tkinclude(c,a,b){if(jQuery("head").hasClass(c)==0){console.log("tkinclude: "+a);loadjscssfile(a,b);jQuery("head").addClass(c);return true}return false};